  const mapRef = useRef(null);
   const loadFromStaticFiles = async () => {
     try {
       const shpRes = await fetch("/data/Charsadda_Roads.shp");
       const dbfRes = await fetch("/data/Charsadda_Roads.dbf");

       const shpBuffer = await shpRes.arrayBuffer();
       const dbfBuffer = await dbfRes.arrayBuffer();

       const source = await shapefile.open(shpBuffer, dbfBuffer);
       const features = [];

       let result;
       while (!(result = await source.read()).done) {
         features.push(result.value);
         console.log(result.value);
         console.log(result.value.geometry.coordinates);
         console.log(result.value.properties);
         console.log(result.value.geometry.type);
       }

       setGeojsonData({ type: "FeatureCollection", features });
     } catch (error) {
       console.error("Failed to load shapefile:", error);
     }
   };
  useEffect(() => {
    if (!mapRef.current) return;

    const allBounds = [];

    // Create vector source for road data
    const roadFeatures = [];

    // Iterate through each road data entry
    Data.forEach((roadData) => {
      const orderedPoints = getOrderedPathPoints(roadData); // Function to process road data

      // Create road polyline (a line feature)
      if (orderedPoints.length > 1) {
        const roadLine = new Feature({
          geometry: new Point(
            fromLonLat([orderedPoints[0].lon, orderedPoints[0].lat])
          ),
        });
        roadFeatures.push(roadLine);
      }

      // Markers for start/end points of roads
      if (orderedPoints.length > 0) {
        addMarker(
          orderedPoints[0].lat,
          orderedPoints[0].lon,
          `<strong>Start:</strong> ${roadData.name || "Unnamed Road"}`,
          "road",
          roadData
        );
        addMarker(
          orderedPoints[orderedPoints.length - 1].lat,
          orderedPoints[orderedPoints.length - 1].lon,
          `<strong>End:</strong> ${roadData.name || "Unnamed Road"}`,
          "road",
          roadData
        );
      }

      // Process bridges, etc.
      roadData.bridges?.forEach((bridge) => {
        addMarker(
          bridge.lat,
          bridge.lon,
          `<strong>Bridge:</strong> ${bridge.name}`,
          "bridge",
          bridge
        );
      });
    });
 
      

    // Create a map instance
    const map = new Map({
      target: mapRef.current,
      layers: [
        new TileLayer({
          source: new OSM(),
        }),
        new VectorLayer({
          source: new VectorSource({
            features: roadFeatures, // Vector layer for roads
          }),
        }),
      ],
      view: new View({
        center: fromLonLat([71.73, 34.0167]), // Example center
        zoom: 14,
      }),
    });

    return () => map.setTarget(undefined); // Cleanup on unmount
  }, []);

  // Function to process ordered points (based on your original code logic)
  const getOrderedPathPoints = (roadData) => {
    let points = [];
    if (roadData.start_lat && roadData.start_lon) {
      points.push({ lat: roadData.start_lat, lon: roadData.start_lon });
    }
    if (roadData.end_lat && roadData.end_lon) {
      points.push({ lat: roadData.end_lat, lon: roadData.end_lon });
    }
    // Additional processing for other points if necessary
    return points;
  };

  // Function to add markers (for start/end or other features)
  const addMarker = (lat, lon, popupContent, type, data) => {
    const markerFeature = new Feature({
      geometry: new Point(fromLonLat([lon, lat])),
    });
    
    markerFeature.setStyle(
      new Style({
        image: new CircleStyle({
          radius: 28,
          fill: new Fill({ color: "black" }),
          stroke: new Stroke({ color: "black", width: 13 }),
        }),
      })
    );

    const markerLayer = new VectorLayer({
      source: new VectorSource({
        features: [markerFeature],
      }),
    });

    // Logic for displaying popup content, etc.
    // Use your own logic for popup handling or other customizations

    // Map.addLayer(markerLayer);
  };

  return (
    <div>
      <button
        style={{
          color: "black",
          zIndex: "9999",
          background: "black",
          position: "absolute",
        }}
        onClick={loadFromStaticFiles}
      >
        view kml
      </button>
      <div
        ref={mapRef}
        style={{
          width: "100%",
          height: "100%",
          position: "absolute",
          top: 0,
          left: 0,
        }}
      />
    </div>
  );
